import React from 'react';

class EditBurgerForm extends React.Component {
  render () {
    return (
      <div className='burger-edit'>
        <input name ='name' type = 'text' value={this.props.name}/>
        <input price ='price' type ='text' value={this.props.name}/>
        <select status = 'status' className='status'value={this.props.name}> 
          <option value ='available'>Available</option>
          <option value ='unavailable'>Sold out</option>
        </select>
        <textarea description = 'description' value={this.props.name} />
        <input image = 'image' type='text' />
      </div>
    )
  }
}

export default EditBurgerForm;
